import React, { Component } from 'react';

class ListUserComponent extends Component {
    constructor(props){
        super(props)

        this.state = {
            users: []
        }

    }

    render() {
        return (
            <div>
                <h2 className='text-center'>Users List</h2>
                <div className='row'>
                    <table className='table table-striped table-bordered'>
                        <thead>
                            <tr>
                                <th>UserId</th>
                                <th>Name</th>
                                <th>EmailId</th>
                                <th>UserName</th>
                                <th>Password</th>
                                <th>Role</th>
                                <th>Action</th>
                            </tr>
                        </thead>
                        <tbody>
                            {
                                this.state.users.map(
                                    user =>
                                    <tr key = {user.userId}>
                                        <td> {user.userId} </td>
                                        <td> {user.name} </td>
                                        <td> {user.email} </td>
                                        <td> {user.username} </td>
                                        <td> {user.password} </td>
                                        <td> {user.role} </td>
                                    </tr>
                                )
                            }



                        </tbody>
                    </table>

                </div>

            </div>
        );
    }
}

export default ListUserComponent;
